import "./mySkills.css";

function mySkills() {
  return (
    <div>
      <div className="subtitle" id="mySkills-title" data-aos="fade-right" data-aos-duration="1000">
        My Skills<span style={{ color: "#e4448f" }}>.</span>
      </div>
      <hr id="mySkills-line" data-aos="fade-right" data-aos-duration="1000"></hr>
      <pre id="languages">
        Languages
      </pre>
      <div >
      <div id="languages-graph"></div>
      <pre id="types-languages">C++ Java C C# CSS HTML JS PHP Go</pre>
    <pre id="technologies">
      Technologies
    </pre>
    <div id="technologies-graph"></div>
    </div>
    </div>
  );
}

export default mySkills;
